import styled from "styled-components";
import SelectText from "./SelectText";

const StyledSelectText = styled(SelectText)`
  -webkit-box-align: center;
  align-items: center;
  display: flex;
  flex-wrap: wrap;
  position: relative;
  box-sizing: border-box;
  flex: 1 1 0%;
  overflow: hidden;
`;

export default StyledSelectText;
